  <script src="https://cdnjs.cloudflare.com/ajax/libs/gsap/3.3.1/gsap.min.js"></script>
  
  <script>
    //JS - PATTERNS
    //Selects a button and attaches the event listener to it
    var mql = window.matchMedia('(min-width: 601px)');
    if(mql.matches){
      document.getElementById('btnFull').addEventListener('click', changePattern);
      document.getElementById('btnCircles').addEventListener('click', changePattern);
      document.getElementById('btnHexagon').addEventListener('click', changePattern);
      //function that gets triggered on click, the argument is the event
      function changePattern(event){
        let elementToShow = '.pattern' + event.target.id;
        console.log(event.target.id);
        //drilling inside the event to get the button id
        gsap.to('.pattern', {opacity:0, duration: .5});
        gsap.to(elementToShow, {opacity: 1, duration: .5, delay: .5});
      }
    }
    var mql = window.matchMedia('(max-width: 600px)');
    if(mql.matches){
      document.getElementById('btnFull').addEventListener('click', changePattern);
      document.getElementById('btnCircles').addEventListener('click', changePattern);
      document.getElementById('btnHexagon').addEventListener('click', changePattern);
      
      function changePattern(event){
        let elementToShow = '.patternmob' + event.target.id;
        console.log(event.target.id);
        //drilling inside the event to get the button id
        gsap.to('.pattern', {opacity:0, duration: .5});
        gsap.to(elementToShow, {opacity: 1, duration: .5, delay: .5});
      }
    }

    //JS - COLOURS
    document.getElementById('btnGrey').addEventListener('click', changeColor);
    document.getElementById('btnYellow').addEventListener('click', changeColor);
    document.getElementById('btnBlue').addEventListener('click', changeColor);

    function changeColor(event){
      let elementToShow = '#color' + event.target.id;
      console.log(event.target.id);

      gsap.to('.color', {opacity: 0, duration: .3})
      gsap.to(elementToShow, {opacity: 0.6, duration: .3, delay: .3});
    }
    //JS - PERSPECTIVES
    document.getElementById('btnLamp').addEventListener('click', changePerspective);
    document.getElementById('btnBureau').addEventListener('click', changePerspective);
    document.getElementById('btnSofa').addEventListener('click', changePerspective);

    function changePerspective(event){
      let elementToShow = '#persp' + event.target.id;
      console.log(event.target.id);
      gsap.to('.persp', {opacity: 0, duration: .3});
      gsap.to(elementToShow, {opacity: 1, duration: .3, delay: .3});
    }
  </script>
